Object.keys(classes).map((className) => {
  classes[className].icon = (props) => {
    const _props = {
      ...props,
      viewBox: '0 0 24 24',
    }
    return (
      <SvgIcon {..._props}>
        {classes[className].svgPath}
      </SvgIcon>
    )
  }
})

const ClassIcon = ({class: characterClass, ...props}) => {
  const pick = classes[characterClass]
  if (pick) return pick.icon(props)
  return (props) => {
    const _props = {
      ...props,
      viewBox: '0 0 24 24',
    }
    return (
      <SvgIcon {..._props} />
    )
  }
}

export default ClassIcon
